import React from "react";
import { Route } from "react-router-dom";
import { IndexHtml } from "../components/IndexHtml.component";

export const RouterLogin = () => {
  return (
    <React.Fragment>
      <Route index path="/" element={<IndexHtml />}></Route>
    </React.Fragment>
  );
};
